import React, { useState } from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Seating from "../pages/Seating/Seating";
// import LayoutRegister from "../pages/LayoutRegister/LayoutRegister";
import RegisterForm from "../pages/LayoutForm/LayoutForm";
import {CompanyName} from "../context/CreateContext";
import { LoginPage } from "../pages/LoginPage/LoginPage";
import LayoutForm from "../pages/LayoutForm/LayoutForm";
import { AllLayouts } from "../pages/AllLayouts/AllLayouts";
import{ LayoutRegister }from "../pages/LayoutRegister/LayoutRegister";

const MainRoutes = () => {
  const[companyName,setCompanyName]=useState("")
  return (
    <BrowserRouter>
    <CompanyName.Provider value={{companyName,setCompanyName}}>
      <Routes>
        <Route path="/seating" element={<Seating />} />
        <Route path="/layoutregister" element={<LayoutRegister/>}/>
        <Route path="/layout" element={<LayoutForm/>}/>
        <Route path="/login" element={<LoginPage/>}/>
        <Route path="/register" element={<RegisterForm/>}/>
        <Route path="/alllayout" element={<AllLayouts/>}/>
        <Route path="home" element={<Home/>}/>
      </Routes>
      </CompanyName.Provider>
    </BrowserRouter>
  );
};

export default MainRoutes;
